import React, { useEffect, useState } from 'react';
import {fetchData} from './api/api';

const App = () => {
     const [data, setData] = useState({});

     useEffect(() => {
          fetchData(1).then(response => {
               setData(response.data);
          })
     },[]);

     return (
          <div>{ data }</div>
     );
};

export default App;
